import React, {Component} from 'react';

class Nav extends Component {
    render(){
      var lists = [];
      var data= this.props.data;
      var i = 0;
      while(i < data.length){

        i = i + 1;
      }
      return(
        <nav>
          <ul>
              <li><a href="1.html">HTML</a></li>
              <li><a href="2.html">CSS</a></li>
              <li><a href="3.html">JavaScript</a></li>
          </ul>
        </nav>
      );
    }
  }

export default Nav;
